	('3d97315b-1dd5-41d5-8fc7-40d0144b7734', '🎯_mission_chunk_0', '**To create future-proof AI infrastructures that allow businesses to grow autonomously and operate 24/7 without manual bottlenecks.** Avenir''s mission is to eliminate the gap between intent and action in business growth. Every lead, every conversation, and every interaction is analyzed, scored, and acted upon — automatically. **Core Beliefs:** 1. Growth should compound automatically, not linearly 2. AI should adapt to your business, not the other way around 3. Every interaction contains intelligence — systems should extract it 4. Bilingual capability is not optional in Canadian markets 5. Automation should feel human, not robotic ---', '[-0.015840933,0.008448498,0.04358935,0.020095794,0.043834236,-0.04539537,-0.0075722723,0.041752722,-0.02014171,0.047844213,0.025927093,-0.038997777,0.0040061492,-0.061618935,-0.021702845,0.04658918,0.020784529,-0.030549278,-0.020034572,-0.037620302,0.033365443,0.022116086,0.015190461,-0.0027032897,-0.036671378,-0.007212599,-0.0021886507,0.07248566,-0.026263809,-0.060241465,0.016927605,-0.010453486,-0.053568374,0.028314712,-0.0047446275,-0.0064128996,0.015052713,-0.010637148,0.016483754,0.009596392,-0.018993815,-0.01900912,0.04600758,0.028238187,-0.02787086,0.0047752378,-0.03856923,-0.018748932,-0.02210078,0.04404851,-0.09587208,-0.024381263,-0.022162002,0.040773187,-0.033947043,0.025177136,-0.010208601,0.0008226572,0.0015429605,0.024365958,0.01985091,-0.04912985,0.03422254,0.011677906,-0.024595536,0.022850737,-0.028299406,0.02816166,0.006366984,0.023493558,0.0046374905,0.02020293,0.0046068802,-0.0122901155,0.0012215503,-0.039426323,0.00017959754,0.018794846,-0.004947422,-0.040956847,-0.06241481,0.0023857057,-0.008555635,-0.0030591367,-0.019606024,-0.055466224,-0.023860885,-0.02516183,-0.070587814,0.011004475,0.0035106416,0.0239068,-0.028314712,0.009068361,0.04046708,0.000860442,0.05206846,0.020631477,0.01991213,0.029493216,-0.004335212,-0.050476715,-0.0039257966,0.02727