	('faf3447f-f9d9-4667-9dd5-0f29e4d8dd5f', '👥_ideal_clients_chunk_0', '### **Primary Target Profile:** **Growth-oriented SMBs in Canada** seeking to scale operations through intelligent automation rather than hiring. **Company Size:** - 2-50 employees (sweet spot: 5-25) - Growing beyond manual processes - Not large enough for enterprise solutions - Ready to invest in infrastructure **Industries (Priority Order):** 1. **Construction** (Automation Score: 70-95) - Commercial contractors - Residential builders - Specialized construction services - Project-based workflows - High lead volume, manual follow-up bottlenecks 2. **Real Estate** (Automation Score: 70-95) - Property management firms - Real estate brokerages - Commercial real estate groups - High client interaction volume - Need for instant response capability 3. **Marketing Agencies** (Automation Score: 60-90) - Digital marketing agencies - Creative studios - Brand consulting firms - Managing multiple client accounts - Need for streamlined client communication 4. **Professional Services** (Automation Score: 60-90) - Legal practices - Accounting firms - Consulting groups - Healthcare providers - High-value, relationship-driven businesses 5. **Home Services** (Automation Score: 70-90) - HVAC companies - Plumbing services - Electrical contractors - Renovation specialists - High inquiry volume, seasonal peaks **Geographic Regions:** - **Primary:** Quebec (QC), Ontario (ON), British Columbia (BC) - **Secondary:** Alberta (AB), Maritime provinces - **Language Distribution:** English-dominant with French capability essential for Quebec **Digital Maturity Indicators:** - Active website with contact forms - Online lead generation (even if manual) - Basic CRM or spreadsheet system - Email-based client communication - LinkedIn presence - Willing to integrate APIs ---', '[-0.026144013,0.029073706,0.07600458,0.01815014,-0.008558886,-0.0063023255,-0.036969922,0.042773504,-0.025878945,0.044001184,0.004405001,-0.040011223,-0.000