	('8fe7e612-e1a9-4042-8fa1-d6008ed076df', '❌_exclusions_(non-ideal_prospects)_chunk_0', '### **Not a Good Fit:** **Large Enterprises (500+ employees):** - Heavy legacy systems - Internal IT teams - Long procurement cycles - Prefer custom enterprise solutions - **Why excluded:** Avenir is built for agility, not bureaucracy **Freelancers / Solopreneurs:** - No team to leverage time savings - Limited lead volume - Cannot justify infrastructure investment - **Why excluded:** Avenir''s value scales with team size **No Digital Presence:** - No website or inactive online presence - Manual-only operations (no email) - Not collecting leads online - **Why excluded:** Avenir requires digital touchpoints **Outside North America:** - Time zone misalignment - Different business practices - Language requirements beyond EN/FR - **Why excluded:** Geographic and cultural specialization **Pure E-Commerce:** - Transactional, not relationship-driven - Already heavily automated - Different sales cycle - **Why excluded:** Avenir optimizes for service businesses **Early-Stage Startups:** - Still validating product-market fit - Unstable lead volume - Limited budget - **Why excluded:** Need proven processes to automate ---', '[-0.033335898,0.013325603,0.042618576,-0.0008998978,-0.023119118,0.0033295762,-0.05289374,0.008895897,-0.0031963931,0.06807296,-0.01742691,-0.08739727,-0.0007612415,-0.008370463,0.02304614,0.05006223,0.044311643,-0.05800213,-0.052776974,0.010479499,0.0644533,0.044720314,0.0032146373,-0.0046741776,-0.01542734,-0.003973598,-0.026870135,0.041947186,0.043435916,-0.032109886,0.034737058,-0.025498169,-0.006619015,0.014237815,-0.03765614,0.028110744,0.05187206,0.013756167,0.032168265,0.029001065,-0.020564921,-0.013581022,0.032401793,-0.013420473,0.00020422161,0.046267424,0.0053163753,0.010997635,-0.0072867544,-0.011311437,-0.050529283,-0.014661082,0.027848028,-0.02336724,-0.034211624,-0.039320014,-0.039378397,-0.031000635,-0.026432274,0.049916275,0.029453522,-0.058994617,0.040