	('2e4e9691-d65e-42c6-807c-d882193b7933', '🎨_tone_and_communication_style_chunk_0', 'Based on Avenir''s actual outreach templates and UI language: ### **Brand Voice Characteristics:** **Confident but not arrogant:** - "We help businesses like yours" (partnership tone) - "I can walk you through" (personal, human) - "It only takes 15 minutes" (respectful of time) **Tech-forward but accessible:** - Avoids jargon ("smart AI workflows" not "ML pipelines") - Shows results first, technology second - Visual demos over technical specs **Professional yet personal:** - "Hello [business] team" (warm greeting) - "I came across your work" (researched, specific) - "Cordialement" in French (culturally appropriate) **Results-driven:** - "10+ hours per week saved" - "80% time savings" - "24/7 operation" - Quantifiable, credible claims **Bilingual-ready:** - Not just translation — cultural adaptation - Quebec French (not European French) - Seamless language switching - Equal quality in both languages **Communication Principles:** 1. Lead with value, not features 2. Show don''t tell (live demo dashboard) 3. Respect their time (15-minute demos) 4. Personal but scalable 5. Human-sounding automation ---', '[-0.013647493,0.017754378,-0.00039587996,0.010251415,0.00013154864,-0.031101752,-0.044954587,0.045175727,-0.0018115704,0.050862182,0.002248914,-0.07006977,0.000254459,-0.073860735,-0.011586153,0.0761985,0.009050941,-0.035287615,-0.057338424,-0.026931684,0.044006847,0.028290115,-0.025304725,0.050040808,-0.023819929,-0.014405686,-0.035319205,0.037530605,0.024578124,-0.041827038,-0.0024522839,-0.023456628,-0.014453074,0.00787811,-0.013679084,0.016854022,-0.0046952744,-0.020834541,0.032602344,0.0051296568,-0.03522443,0.0068592867,0.060592342,-0.01881269,-0.024451757,0.031243913,-0.018180862,-0.008016323,-0.011570357,0.021750692,-0.028242728,-0.0007187048,-0.008055812,0.030864816,-0.0412268,-0.0018382256,0.00274253,-0.0009586021,-0.013189417,0.006571015,0.028779782,-0.06021324,0.023361854,0.