	('d0be86b2-4127-487a-8525-017fa601db71', '📊_example_ideal_prospect_profiles_chunk_0', '### **Profile 1: Digital Agency in Toronto** ```yaml Business: "Digital Growth Agency" Industry: Marketing Location: Toronto, ON Employees: 12 Pain Point: "Using spreadsheets and manual outreach for client management" Current State: Growing fast, losing track of leads Automation Need Score: 85/100 Ideal Match: ✅ YES Why Perfect Fit: - Service-based with high client interaction volume - Outgrowing manual processes - Tech-savvy enough to adopt AI - Can demonstrate ROI quickly (saves 10+ hours/week) - English-dominant but needs bilingual for Quebec clients ``` ### **Profile 2: Real Estate Group in Quebec** ```yaml Business: "Horizon Propriétés" Industry: Real Estate Location: Montreal, QC Employees: 30 Pain Point: "Need automated lead routing and bilingual follow-ups" Current State: Mixed FR/EN inquiries, manual triage Automation Need Score: 90/100 Ideal Match: ✅ YES Why Perfect Fit: - Bilingual market (must handle FR and EN seamlessly) - High lead volume from web forms - Time-sensitive (real estate moves fast) - Relationship-driven (AI relationship tracking adds value) - Ready to pay for time savings and better conversion ``` ### **Profile 3: Construction Company in Vancouver** ```yaml Business: "Pacific Builders Inc" Industry: Construction Location: Vancouver, BC Employees: 18 Pain Point: "Quotes lost due to slow email responses, no CRM" Current State: Email chaos, missed opportunities Automation Need Score: 78/100 Ideal Match: ✅ YES Why Perfect Fit: - Project-based sales (each lead = high value) - Slow manual follow-up losing deals - Simple tech stack (ready for upgrade) - Proven ROI (one extra project pays for years) - English-only simplifies implementation ``` ### **Profile 4: Law Firm in Ottawa** ```yaml Business: "Capital Legal Partners" Industry: Legal (Professional Services) Location: Ottawa, ON Employees: 8 Pain Point: "Intake forms creating admin burden, need better qualification" Current State: Paralegals manually triaging inquiries Automation Need Score: 72/100 Ideal Match: ✅ YES Why Perfect Fit: - High-value clients (worth the automation investment) - Clear qualification criteria (AI can learn patterns) - Bilingual necessity (federal capital) - Professional image maintained (AI writes like humans) - Compliance-friendly (data stays in Canada via Supabase) ``` ---', '[-0.04083954,0.020806944,0.049873568,0.04095426,0.009636296,-0.018612966,-0.034960255,0.028148884,-0.010969891,0.03134664,0.023287715,-0.0420154,0.019243913,-0.036050074,0.0029719083,0.055351347,0.043162577,-0.026012264,-0.06372575,0.0053272084,0.037598763,0.0064672166,0.009120067,-0.012984622,0.001392746,0.012109899,-0.033784397,0.021122418,0.00031793863,-0.01941599,0.03949161,-0.030687016,-0.039548967,0.006198347,-0.0035849316,-0.0034146474,-0.0022101104,0.020706566,0.016576724,-0.021380533,0.032092307,-0.002620585,0.04562901,0.009198935,0.012869905,0.0069798618,-0.023373755,0.008023077,-0.0059151375,-0.0013909535,-0.047550533,0.029210024,-0.0017799186,-0.015960116,-0.02357451,-0.024348857,-0.042130116,-0.006083629,0.041183695,0.030199464,0.03464478,-0.028650774,0.054290205,0.020720905,-0.028693793,-0.00444173,-0.045973163,-0.024850747,0.019530708,0.020706566,0.04293314,0.047521856,0.056756638,0.014999354,0.024807727,-0.03146136,0.0089623295,0.0589076,-0.051135466,-0.046432037,-0.05913703,0.015702,0.018039376,-0.02523792,-0.040667467,-0.009084217,-0.02787643,-0.060054775,-0.050246403,0.018655984,-0.02839266,0.022728467,0.0021886008,-0.010582718,0.05727287,-0.037971597,-0.013837837,0.048841108,-0.0022638843,0.034730818,0.014103121,-0.010855173,-0.0021760536,0.009284973,0.042990502,0.007650244,0.030056067,0.03045758,0.011722727,-0.030687016,-0.123551086,0.0050189043,-0.040753502,0.026600193,-0.024893766,-0.009041198,-0.037082534,-0.016433327,-0.03355496,-0.056383807,-0.021968462,0.013214058,0.0011758576,0.023388095,0.0012170844,0.005108528,-0.007571376,-0.003251533,-0.