	('7b645660-5bda-4183-a1ab-d418e06c80c0', '🔍_success_indicators_(behavioral_signals)_chunk_0', 'When scanning prospects, these signals indicate strong fit: ### **High-Confidence Indicators (Each +10 to +15 points):** - ✅ Has online contact form (automatable entry point) - ✅ Active LinkedIn company page (professional presence) - ✅ 5-50 employees (sweet spot for ROI) - ✅ Founded 2015 or later (tech-ready culture) - ✅ Email address publicly available (open to outreach) - ✅ Canada-based, especially QC (bilingual need) - ✅ Multiple contact paths (/contact, /quote, /inquiry) ### **Medium-Confidence Indicators (Each +5 to +10 points):** - ✅ Website form with basic fields only (no complex CAPTCHA) - ✅ Industry: Construction, Real Estate, Marketing, Legal, Healthcare - ✅ Contact email format: contact@, info@, sales@ (professional) - ✅ Data enriched via PDL or Apollo (verified company data) - ✅ Website mentions "team" or "clients" (service business) ### **Red Flags (Each -5 to -10 points):** - ❌ No website or inactive site - ❌ 500+ employees (too large, enterprise-focused) - ❌ 1-2 employees (too small, freelancer) - ❌ Outside North America - ❌ E-commerce only (not service-based) - ❌ Heavy CAPTCHA or bot protection (indicates automation resistance) - ❌ No contact form or email (unreachable) ### **Automation Need Formula (from codebase):** ``` Base Score: - Construction, Real Estate, Home Services: 70-95 - Marketing, Legal, Healthcare: 60-90 - Other: 50-90 Adjustments: + Region CA/QC: +10 + Small team (< 50): +15 + Founded 2015+: +10 + Has form: +10 + No CAPTCHA: +10 + Verified LinkedIn: +5 + PDL/Apollo source: +10 - No form: -10 Final Score: Sum of factors (capped 45-95) ``` ---', '[-0.017212318,0.041621096,0.034362327,0.033022728,0.035483856,-0.011690357,-0.04377069,0.009642013,-0.005362299,0.040966872,0.013341493,-0.035483856,-0.004579567,-0.026620679,0.03157409,0.0646747,0.02887931,-0.057384778,-0.06034436,-0.0061138775,0.058724377,-0.0039603906,-0.019642292,-0.009883453,0.