	('be2a1648-28e8-44ce-b5c8-59bf24d995b2', '🚫_exclusions_(non-ideal)_chunk_0', '### **Companies to Avoid:** 1. **Large Enterprises (500+ employees)** - Require custom enterprise contracts - Procurement cycles 6+ months - In-house IT teams (build vs. buy) - Complex compliance requirements - **Better fit:** Enterprise SaaS providers 2. **Freelancers / Solo Operations** - Cannot leverage team time savings - Low lead volume - Price-sensitive - Manual processes acceptable - **Better fit:** Productivity tools, not infrastructure 3. **No Digital Presence** - No website or outdated site - Manual-only operations - Not collecting leads online - No email communication - **Better fit:** Traditional business consulting 4. **Non-North American** - Time zone challenges - Different business cultures - Language beyond EN/FR - Regulatory differences - **Better fit:** Local AI providers 5. **Pure E-Commerce / Transactional** - Already heavily automated (Shopify, etc.) - Low-touch sales model - Different automation needs - **Better fit:** E-commerce automation tools 6. **Early-Stage Startups (Pre-Product-Market Fit)** - Unstable processes - Changing business model - Limited budget - Uncertain lead volume - **Better fit:** Wait until Series A or proven revenue ---', '[-0.040627185,0.022990141,0.073140204,0.008085993,0.0060644946,-0.016073376,-0.029498378,0.033358242,-0.0066385437,0.033104673,0.016425554,-0.06406811,0.008374779,-0.030287256,0.017777914,0.05820788,0.028399585,-0.044881485,-0.039894655,0.004768482,0.056883693,0.017228518,0.00526153,0.003442534,0.003740124,0.005979972,-0.017115822,0.053277396,0.033301894,-0.009029828,0.057982486,-0.018594967,-0.02662461,-0.007163288,-0.007867643,0.015932506,-0.0044761747,0.047698908,0.04860048,0.012812214,-0.01095976,0.005346053,0.0038457771,-0.010804802,0.007818338,-0.0050396584,-0.008825566,-0.047839776,-0.0019369756,-0.0036520795,-0.05336192,0.013826485,0.044656094,-0.023243709,-0.038767688,-0.040091876,-0.0095087895,-0.03890856,0.0027452