	('289064c8-cae0-4533-ad0e-e731a80a8194', '🧠_ai_matching_use_case_chunk_0', '### **How This Profile Is Used:** This document serves as **Avenir''s business DNA** for the AI matching system. When scanning new prospect companies, the AI: 1. **Vectorizes this profile** into a semantic representation 2. **Compares prospect data** against Avenir''s ideal characteristics 3. **Calculates Business Fit Score** (0-100) 4. **Generates reasoning summary** explaining the match quality 5. **Determines outreach priority** and personalization strategy ### **Matching Algorithm (Conceptual):** ``` Business Fit Score = Weighted Sum of: - Industry Match (30%) - Company Size Match (20%) - Geographic Match (15%) - Digital Maturity (15%) - Pain Point Alignment (20%) Where: 90-100 = Perfect fit (immediate outreach) 75-89 = Strong fit (prioritize) 60-74 = Moderate fit (nurture) < 60 = Weak fit (skip or long-term nurture) ``` ### **Output Format (Bilingual):** **English:** ``` Business Fit Score: 87/100 Reasoning: - Construction industry (strong automation need) - 18 employees (ideal size for infrastructure investment) - Toronto-based (target market) - Active website with form (automatable touchpoint) - LinkedIn verified (professional presence) Recommended Approach: Immediate personalized outreach Pain Points to Emphasize: Manual quote delays, lead tracking chaos ``` **French:** ``` Score d''Adéquation: 87/100 Raisonnement: - Industrie de la construction (besoin élevé d''automatisation) - 18 employés (taille idéale pour investissement infrastructure) - Basé à Toronto (marché cible) - Site web actif avec formulaire (point de contact automatisable) - LinkedIn vérifié (présence professionnelle) Approche Recommandée: Sensibilisation personnalisée immédiate Points de Douleur à Souligner: Retards de devis, chaos de suivi des leads ``` ---', '[-0.036126938,0.028837401,0.029099826,-0.027117072,0.013850117,-0.035864513,-0.03685589,0.008987998,-0.021445813,0.041492037,-0.0029795975,-0.06578077,0.00282